            let currentFrame = 0;
            let isPlaying = false;
            let intervalId = null;
            
            const frame0Img = document.getElementById('frame0');
            const frame1Img = document.getElementById('frame1');
            const playButton = document.getElementById('playButton');
            const frameSlider = document.getElementById('frameSlider');
            const frameCounter = document.getElementById('frameCounter');
            const fpsInput = document.getElementById('fpsInput');
            
            function updateFrames(frame) {
                frame0Img.src = `data:image/png;base64,${frames0[frame]}`;
                frame1Img.src = `data:image/png;base64,${frames1[frame]}`;
                frameSlider.value = frame;
                frameCounter.textContent = `Frame: ${frame}`;
            }
            
            function play() {
                if (isPlaying) {
                    clearInterval(intervalId);
                    playButton.textContent = 'Play';
                    isPlaying = false;
                } else {
                    playButton.textContent = 'Pause';
                    isPlaying = true;
                    intervalId = setInterval(() => {
                        currentFrame = (currentFrame + 1) % frames0.length;
                        updateFrames(currentFrame);
                    }, 1000 / parseInt(fpsInput.value));
                }
            }
            
            playButton.addEventListener('click', play);
            frameSlider.addEventListener('input', (e) => {
                currentFrame = parseInt(e.target.value);
                updateFrames(currentFrame);
            });
            
            fpsInput.addEventListener('change', () => {
                if (isPlaying) {
                    clearInterval(intervalId);
                    intervalId = setInterval(() => {
                        currentFrame = (currentFrame + 1) % frames0.length;
                        updateFrames(currentFrame);
                    }, 1000 / parseInt(fpsInput.value));
                }
            });
        </script>
